import './AboutPage.scss';

function AboutPage() {
    return (
        <article className="about-page">
            <div className="about-page__wrap">
                <h3 className="about-page__quote">About Page</h3>
                <div className="about-page__buttons">
                    {/* <button className="about-page__btn">Learn More</button> */}
                    <button className="about-page__btn">See Projects</button>
                </div>
            </div>
        </article>
    );
}

export default AboutPage;
